import React, { Component } from 'react';

export class OutcomeList extends Component {
	render() {
		const { outcomes } = this.props;
		const renderedList = outcomes.map((outcome, key) => {
			return (
				<div>
					<OutcomeItem />
				</div>
			);
		});
		return <div>{renderedList}</div>;
	}
}

export default OutcomeList;
